import './NavigationBar.css';
import {
    Navbar,
    NavItem,
    NavLink
} from 'reactstrap';

export default class NavigationBar extends Component{

    render(){
        return(
            <div>
                <Navbar color="light" >
                    dummy
                    <NavItem>
                        <NavLink href="">Jacob</NavLink>
                    </NavItem>

                    <NavItem>
                        <NavLink href="">Shreya</NavLink>
                    </NavItem>

                    <NavItem>
                        <NavLink href="">Mari</NavLink>
                    </NavItem>

                    <NavItem>
                        <NavLink href="">Name</NavLink>
                    </NavItem>
                </Navbar>
            </div>
        )
    }
};
